    "sourceText": "md`\n---\n### Extrude\n2D shapes can be 'extruded' to create 3D shapes. This can be abbreviated to .e() for brevity.\n\nA series of extends can be provided, these will be sorted and paired. Zero will be added if the number of extents is odd.\n\ne.g., s.ez(1, 2, 3, 4) will produce two extrusions -- one from 1z to 2z, and one from 3z to 4z.\n`;",
    "sourceLocation": {

      "id": "$4"

    "md": "\n---\n### Extrude\n2D shapes can be 'extruded' to create 3D shapes. This can be abbreviated to .e() for brevity.\n\nA series of extends can be provided, these will be sorted and paired. Zero will be added if the number of extents is odd.\n\ne.g., s.ez(1, 2, 3, 4) will produce two extrusions -- one from 1z to 2z, and one from 3z to 4z.\n",

  {
    "hash": "SQgb0ZZeQ51se0hO6/PM2rWGSTtYRUYzsHv6Ap+tC6s=",
    "sourceText": "md`\n---\n### Item\nGeometry can be formed into an 'item'.\n\nAn item has an exterior (which looks like an individual piece of geometry), and an interior (which may contain many distinct pieces of geometry).\n\nThe interior has its own frame of reference independent of any transformation of the exterior of the item.\n\nSince an item appears individual from the outside, tag and path selectors need to explicitly select item to access the interior.\n\nThere are a number of item specific operators. .in() will enter an item, .asPart(\"Bolt\") will define an item which is specified as a part. Parts can be listed with the .bom() operation.\n`;",
    "sourceLocation": {
      "path": "nb/documentation/interactions_with_geometry/interactions_with_geometry.nb",
      "id": "$14"
    }
  },
  {
    "md": "\n---\n### Item\nGeometry can be formed into an 'item'.\n\nAn item has an exterior (which looks like an individual piece of geometry), and an interior (which may contain many distinct pieces of geometry).\n\nThe interior has its own frame of reference independent of any transformation of the exterior of the item.\n\nSince an item appears individual from the outside, tag and path selectors need to explicitly select item to access the interior.\n\nThere are a number of item specific operators. .in() will enter an item, .asPart(\"Bolt\") will define an item which is specified as a part. Parts can be listed with the .bom() operation.\n",
    "hash": "TUcDZJYpZlwUGZ72sFKWn8IhyNdoYA7o0aU/XffdtSQ=",
    "sourceLocation": {
      "path": "nb/documentation/interactions_with_geometry/interactions_with_geometry.nb",
      "id": "$14"
    }
  },

    "hash": "vRWPGQiClf0Zf67brsVDyKUdI1ibcaCiMxJlj/kK0f4=",
    "sourceText": "md`\n---\n### Remesh\nRemesh can be used to break up the segments of a shape allowing it to be distorted.\nshape.remesh(4, 2) first breaks segments longer than 4 and then breaks segments longer than 2.\nAt each step the shape is retriangulated to preserve manifold structure.\n`;",
    "sourceLocation": {
      "path": "nb/documentation/interactions_with_geometry/interactions_with_geometry.nb",
      "id": "$29"
    }
  },
  {
    "md": "\n---\n### Remesh\nRemesh can be used to break up the segments of a shape allowing it to be distorted.\nshape.remesh(4, 2) first breaks segments longer than 4 and then breaks segments longer than 2.\nAt each step the shape is retriangulated to preserve manifold structure.\n",
    "hash": "2RUS9Y6PYaa+eyfREoopMkf0atD53l52SCeJKGK2j5k=",
    "sourceLocation": {
      "path": "nb/documentation/interactions_with_geometry/interactions_with_geometry.nb",
      "id": "$29"
    }
  },
  {
    "hash": "RMvQtIjmMhSsrAXBrjki36oj/WZ72kocmY5TyBFIqt4=",
    "sourceText": "md`Once a shape is remeshed it can be twisted or bent about the origin.`;",
    "sourceLocation": {

    }
  },
  {

    "hash": "GGjbSfRXWo2FBWjrtt6xPHwQl2apBx3GWdbiIqbXkDw=",
    "sourceText": "md`\n---\n#### Selection\nWe can select parts of geometry based on tags using get(selector), getNot(selector), and nth(number).\nAliases g, ng, and n are also available.\n\nSelector is in the form of 'namespace:value', with namespace defaulting to 'item'.\n\nvalue may also be the wildcard *.\n\nSelection does not traverse through item, except for the input shape.\n\nThis means that s.get('a').get('b') will find b inside a, but otherwise b would not be found.\n`;",
    "sourceLocation": {
      "path": "nb/documentation/interactions_with_geometry/interactions_with_geometry.nb",
      "id": "$50"
    }
  },
  {
    "md": "\n---\n#### Selection\nWe can select parts of geometry based on tags using get(selector), getNot(selector), and nth(number).\nAliases g, ng, and n are also available.\n\nSelector is in the form of 'namespace:value', with namespace defaulting to 'item'.\n\nvalue may also be the wildcard *.\n\nSelection does not traverse through item, except for the input shape.\n\nThis means that s.get('a').get('b') will find b inside a, but otherwise b would not be found.\n",
    "hash": "etycjAmgnPYNzYopd8LkdMs4SiOPg4Z9H34dLd3++mo=",
    "sourceLocation": {
      "path": "nb/documentation/interactions_with_geometry/interactions_with_geometry.nb",
      "id": "$50"
    }
  },

    const prepareViews = async (notebook) => {
      // Prepare the view urls in the browser.
      for (const note of notebook) {
        if (note.view && !note.url) {
          note.url = await dataUrl(Shape.fromGeometry(note.data), note.view);
        }
      }
      return notebook;
    }

    const run = async () => {
      const body = document.getElementsByTagName('body')[0];
      const bookElement = document.createElement('div');
      const notebookElement = await toDomElement(await prepareViews(notebook));
      bookElement.appendChild(notebookElement);
      body.appendChild(bookElement);
      bookElement.classList.add('book', 'notebook', 'loaded');
    };

    if (document.readyState === 'complete') {
      run();
    } else {
      document.onreadystatechange = () => {
        if (document.readyState === 'complete') {
          run();
        }
      };
    }
  </script>
